.infobox-image {
    text-align: center;
    padding: 10px 0;
}

.infobox-caption {
    font-size: 90%;
    font-style: italic;
    padding: 4px;
}

/* TOC */
#toc {
    background-color: #f8f9fa;
    border: 1px solid #a2a9b1;
    padding: 12px;
    font-size: 95%;
    display: inline-block;
    min-width: 200px;
    border-radius: 2px;
    margin: 1em 0;
}

#toc h2 {
    display: inline;
    border: none;
    padding: 0;
    font-size: 100%;
    font-weight: bold;
    font-family: sans-serif;
}

#toc ul {
    list-style: none;
    margin: 0;
    padding: 0;
}

#toc li {
    margin-bottom: 2px;
}

#toc .tocnumber {
    color: #202122;
    padding-right: 0.5em;
}

/* REFERENCES */
.reflist {
    font-size: 90%;
    margin-bottom: 0.5em;
    list-style-type: decimal;
    padding-left: 2em;
}

/* NOTICES / AMBOX */
.ambox {
    border: 1px solid #a2a9b1;
    border-left: 10px solid #f28500;
    background: #fbfbfb;
    margin: 0 0 1.5em 0;
    padding: 0.75em 1em;
    font-size: 90%;
    border-radius: 2px;
}

.ambox-notice { border-left-color: #1e90ff; }
.ambox-warning { border-left-color: #f28500; }
.ambox-serious { border-left-color: #b22222; }
.ambox-merge { border-left-color: #9932cc; }
.ambox-style { border-left-color: #808080; }

/* BLOCKQUOTE */
blockquote {
    margin: 1em 2em;
    padding-left: 1em;
    border-left: 3px solid #a2a9b1;
    font-style: italic;
    color: #54595d;
}

/* TABLES */
.wikitable {
    border-collapse: collapse;
    margin: 1em 0;
    background-color: #f8f9fa;
}

.wikitable th, .wikitable td {
    border: 1px solid #a2a9b1;
    padding: 0.4em 0.6em;
}

.wikitable th {
    background-color: #eaecf0;
    text-align: left;
}

/* HATNOTE */
.hatnote {
    font-style: italic;
    padding-left: 1.6em;
    margin-bottom: 0.5em;
}

/* NAVIGATION */
#wiki-nav {
    max-width: 900px;
    margin: 0 auto 1em auto;
    padding: 0.5em 1em;
    font-size: 90%;
    color: #54595d;
}

#wiki-nav a {
    margin: 0 0.5em;
}

/* CATEGORIES */
#catlinks {
    margin-top: 2em;
    padding: 0.5em;
    background-color: #f8f9fa;
    border: 1px solid #a2a9b1;
    font-size: 90%;
}

/* EQUATIONS */
.equation {
    text-align: center;
    font-family: 'Times New Roman', serif;
    font-size: 1.1em;
    margin: 1em 0;
}

/* RESPONSIVE DESIGN */
@media (max-width: 1024px) {
    #content {
        max-width: 95%;
        padding: 2em;
    }

    .infobox {
        width: 20em;
    }
}

@media (max-width: 768px) {
    #content {
        padding: 1.5em;
        max-width: 100%;
    }

    .infobox {
        float: none;
        width: 100%;
        margin: 1.5em 0;
    }

    h1#firstHeading {
        font-size: 1.6em;
    }

    #toc {
        width: 100%;
    }

    .ambox {
        margin: 0 0 1em 0;
    }

    .wikitable {
        font-size: 90%;
    }
}

@media (max-width: 480px) {
    body {
        font-size: 13px;
    }

    #content {
        padding: 1em;
    }

    h1#firstHeading {
        font-size: 1.4em;
    }

    h2 {
        font-size: 1.3em;
    }
}

